import React from "react";
import "../style.css";
import { WHATS_NEW } from "../js/data";
import { FaComment } from 'react-icons/fa';

function SingleProject(props) {
    return <article className="whats-new flex">
          <div className="product-details flex">
            <div className="product-name">
              <img src="https://ph-files.imgix.net/acf956a4-15e5-4214-832f-949f0651c289.jpeg?auto=format&auto=compress&codec=mozjpeg&cs=strip&w=80&h=80&fit=crop" alt="product" />
              {console.log(props.img)}
            </div>
            <div className="about-product">
              <h2 className="productName">{props.productName}</h2>
              <p className="description">{props.description}</p>
              <div className="comments-tags flex">
                <p className="comments">FaComment {props.commentCount}</p>
                <a href="ss" className="tags">{props.tags}</a>
              </div>
            </div>
          </div>
          <div className="upvotes">
            <h5>{props.upvoteCount}</h5>
          </div>
        </article>
}

function Newproducts() {
  return <div  className="left-side">
    {WHATS_NEW.map((product) => {
   return <SingleProject productName={product.productName} image={product.img} description={product.description} tags={product.tags} commentCount={product.commentCount}/>
})}
</div>
}




export default Newproducts;
